import React from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PersonalDetails from '../PersonalDetail/PersonalDetails';
import HomeDetails from '../PersonalDetail/HomeDetails';

function TotalInfo() {
  return (
    <div>
      <Router>
    <nav>
    <link to="personalDetails" style={{display:"block"}}>personalDetails</link>
    <link to="homeDetails" style={{display:"block"}}>homeDetails</link>

    </nav>


      <Routes>
        <Route path="/personalDetails" element={<PersonalDetails />} />
        <Route path="/homeDetails" element={<HomeDetails />} />
      </Routes>
    </Router>
    </div>
  )
}

export default TotalInfo
